import React from 'react';
import "./App.css";

const PaginationComponent = (props) => {
    console.log(props)
    return(
        <div className="page-buttons">
            <button className='pagination-button' onClick={()=>props.changePage(1)} className="page-button">First</button>
            <button className='pagination-button' onClick={()=>props.changePage(props.currentpage>1 ? props.currentpage - 1 : 1)} className="page-button">Prev</button>
            <button className='pagination-button' onClick={()=>props.changePage(1)} className="page-button">1</button>
            <button className='pagination-button' onClick={()=>props.changePage(2)} className="page-button">2</button>
            <button  onClick={()=>props.changePage(3)} className="page-button">3</button>
            <button onClick={()=>props.changePage(4)} className="page-button">4</button>
            <button onClick={()=>props.changePage(5)} className="page-button">5</button>
            <button onClick={()=>props.changePage(props.currentpage<500 ? props.currentpage + 1 : 500)} className="page-button">Next</button>
            <button onClick={()=>props.changePage(500)} className="page-button">Last</button>
        </div>
    );
}
export default PaginationComponent;
